$(document).ready(function(){
  $('#notification').on("click", function() {
    var read_at = Date($.now());
    $('.badgeAlert').remove();
    $.ajax({
      type: 'PUT',
      url: '/sender_recipients',
      data:  {read_at: read_at}
    });
  })
})
